import Layout from '../components/Layout.js';
import fetch from 'isomorphic-unfetch';

const Index = () => {
    return(
        <Layout>Hello World</Layout>
    );
}

/* 
export async function getStaticProps() {
    const result = await fetch('https://cars.amp-dev.se/');
    console.log(result);
    return {{
        props: result
    }}
}
 */

 Index.getInitialProps = async () => {
    const result = await fetch('https://cars.amp-dev.se/products');
    console.log(result);
    return(result);
 }

export default Index;
